import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";


class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      item: [
        {
          id: 1,
          title: 'Стул серый',
          img: 'chair-grey.png',
          desc: 'Lorem ipsum dolor sit amet '
        }
      ]
    }
  }
  render() {
  return (
    <div className="wrapper">
      <Header />
      <Footer />
    </div>
  );
 }
}

export default App;
